import React from "react";
import { HiOutlineMail } from "react-icons/hi";
import { FaWhatsapp } from "react-icons/fa";
import { FaInstagram } from "react-icons/fa";

export default function Contact() {
  return (
    <div style={{ marginLeft: "2.5em", marginTop: "1em" }}>
      <div
        style={{
          display: "flex",
          flexDirection: "row"
        }}
      >
        <div
          style={{
            display: "inline",
            backgroundColor: "blue",
            paddingTop: "1em",
          }}
        >
          <HiOutlineMail size={17} />
        </div>
        <div style={{ paddingBottom: "1em", display: "inline" }}>
          <p className="hoverText">sasky.softwarecompany@gmail.com</p>
        </div>
      </div>
      <br />
      <FaWhatsapp /> <span className="hoverText"> +54 2984391081 </span>
      <br />
      <FaInstagram /> <span className="hoverText"> instagram</span>
    </div>
  );
}
